schemaDefinition: "create or replace view PLS_PROD_QUOTA(\n\t\"PLSTerritoryName\"\
  ,\n\t\"PLSBusinessUnit\",\n\t\"PLSQuarter\",\n\t\"PLSQuota\",\n\t\"PLSBusinessUnitSysID\"\
  ,\n\t\"PLSTerritorySysID\",\n\t\"PLSEmployeeNumber\",\n\t\"PLSEmployeeName\"\n)\
  \ as -- SEMANTIC LAYER BEGINS\n\nSELECT \"TERRITORY\" as \"PLSTerritoryName\",\n\
  \       \"BUSINESSUNIT\" as \"PLSBusinessUnit\",\n       \"QUARTER\" as \"PLSQuarter\"\
  ,\n       \"QUOTA\" as \"PLSQuota\",\n       \"BUSINESSUNITSYSID\" as \"PLSBusinessUnitSysID\"\
  ,\n       \"TERRITORYSYSID\" as \"PLSTerritorySysID\",\n       \"EMPLOYEE_NUMBER\"\
  \ as \"PLSEmployeeNumber\",\n       \"EMPLOYEE_NAME\" as \"PLSEmployeeName\"\nFROM\n\
  \  (SELECT \"TERRITORY\" as \"TERRITORY\",\n          \"BUSINESSUNIT\" as \"BUSINESSUNIT\"\
  ,\n          \"QUARTER\" as \"QUARTER\",\n          \"QUOTA\" as \"QUOTA\",\n  \
  \        \"BUSINESSUNITSYSID\" as \"BUSINESSUNITSYSID\",\n          \"TERRITORYSYSID\"\
  \ as \"TERRITORYSYSID\",\n          \"EMPLOYEE_NUMBER\" as \"EMPLOYEE_NUMBER\",\n\
  \          \"EMPLOYEE_NAME\" as \"EMPLOYEE_NAME\"\n   FROM \"EDW_LS\".\"SALES_EM\"\
  .\"TBLPLSPRODQUOTA\")Projection_1;"
